import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import './bootstrap-5.3.0-alpha3-dist/css/bootstrap.css'
import profileImg from './images/profile_image.jpeg'

const profileImage = (
    <div>
    <img src= {profileImg} alt="taiwoImg" width='155' height='150' className="rounded-circle float-start"/>
    </div>
)

const name = "Taiwo Tom-Ayegunle";
const jobTitle = "React Developer, Nigeria";
const skillTitle = "Skills"

const texts = (
  <header className="texts">
    <h3>{name}</h3>
    <p>{jobTitle}</p>
    <h3>{skillTitle}</h3>
  </header>

)

const skillBadges = (
  <main className= "badges float-start">
    <span>
    <span className="badge h3"><h6 className='pt-1'>HTML</h6></span>
    <span className="badge mx-2"><h6>CSS</h6></span>
    <span className="badge">Sass</span>
    <span className="badge mx-2">JS</span>
    <span className="badge">React</span>
    <span className="badge mx-2">Redux</span>
    <span className="badge">Node</span>
    <span className="badge mx-2">MongoDB</span>
    <span className="badge">Python </span>
    <span className="badge mx-2">Flask</span>
    <span className="badge">Django</span>
    <span className="badge mx-2">NumPy</span>
    <span className="badge">Pandas</span>
    <span className="badge mx-2">Data Analysis</span>
    </span>
    <br/>
    <span className="badge">MySQL</span>
    <span className="badge mx-2">GraphQL</span>
    <span className="badge">D3.js</span>
  </main>
)

const jsxElement = (
  <div className="box1">
    <div className='box2'>
      {profileImage}
      {texts}
      {skillBadges}
    </div>
  </div>

)
const rootElement = document.getElementById('root');
ReactDOM.render(jsxElement, rootElement)
